script: |
  super -f text -I q8839.spq | sort > q8839.out

inputs:
  - name: q8839.spq
    data: |
      SELECT 95 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( - col0 ) NOT IN ( + col2, - col1, + col1 * + col2 - + col2 * - col0 );
  - name: tab2

outputs:
  - name: q8839.out
    data: |
      95
      95
      95
